import { Grid } from '@mui/material'
import React from 'react'
import Logo from './Logo.ico'

const Login = () => {
  return (
    <div>
         <Grid item xs={12} md={6}>

             <img src={Logo} width={700} alt='Logo'/>

         </Grid>







    </div>
  )
}

export default Login
